import React, { Component } from 'react';
import PropTypes from "prop-types"

class IconItem extends Component {
  render() {
    return (
      <div>
        <h1>{this.props.icon.name}</h1>
      </div>
    );
  }
}

//PropTypes
Icons.propTypes = {
  icon: PropTypes.object.isRequired
}

export default IconItem;
